var findMinimumOperations = function(s1, s2, s3) {
    // Finding the shortest string among the three
    let minLength = Math.min(s1.length, s2.length, s3.length);

    // Reducing the strings to the length of the shortest string
    // by removing characters from the end
    let operations = s1.length + s2.length + s3.length - 3 * minLength;

    // Check from the end of the shortest string if all strings have the same suffix
    for (let i = 0; i < minLength; i++) {
